	add("jumbuck", "{\"term\":\"jumbuck\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"Unknown, from pidgin, possibly from an w:Australian Aboriginal languages|Australian Aboriginal language, although it appears also to have moved from pidgin to Aboriginal.\u0026lt;ref name\u003d ANDC\u0026gt;[http://andc.anu.edu.au/australian-words/meanings-origins?field_alphabet_value\u003d151 Australian National Dictionary Centre » Australian words » Meanings and origins of Australian words and idioms » J]\u0026lt;/ref\u0026gt; Numerous derivations have been proposed.* Mr A. Meston of Brisbane, in the \u0027Sydney Bulletin\u0027 of 18 April 1896, cited Aboriginal words \u0027jimba\u0027, \u0027jombock\u0027 (also \u0027jombok\u0027), \u0027dombock\u0027 and \u0027dumbog\u0027, all meaning \u0027\u0026quot;white mist preceding a shower,\u0026quot;\u0027 which a flock of sheep supposedly resembles.\u0026lt;ref name\u003dBaker\u0026gt;\u0027\u00271966\u0027\u0027, Sidney J. Baker, \u0027The Australian Language\u0027, second edition.\u0026lt;/ref\u0026gt;\u0026lt;ref\u0026gt;\u0027\u00271968\u0027\u0027, Edward Ellis Morris, \u0027Austral English\u0027, [http://books.google.com.au/books?id\u003dDzBaAAAAYAAJ\u0026amp;q\u003d%22dumbog%22\u0026amp;dq\u003d%22dumbog%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dGYuST6OMG42CmQWnn7D1AQ\u0026amp;redir_esc\u003dy page 224].\u0026lt;/ref\u0026gt;* Charles Harpur in a handwritten footnote in his papers cites Aboriginal word \u0027junbuc\u0027 or \u0027jimbuc\u0027 (his handwriting is unclear), \u0026quot;a kind of kangaroo or wallaby\u0026quot;, and states that the aborigines of the w:Hunter Valley|Hunter region call the sheep thus for the hairiness of one and the wooliness of the other.\u0026lt;ref name\u003dBaker /\u0026gt;* Also suggested is \u0027jumbock\u0027 (\u0027\u0026quot;to communicate\u0026quot;\u0027).\u0026lt;ref\u0026gt;\u0027\u00271973\u0027\u0027, Richard D. Magoffin, \u0027Fair Dinkum Matilda\u0027, [http://books.google.com.au/books?id\u003d0yrsAAAAMAAJ\u0026amp;q\u003d%22listed+the+word+jumbuck+as+a+verb%22\u0026amp;dq\u003d%22listed+the+word+jumbuck+as+a+verb%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003d04SST5jLCdD1mAXtpMWDAg\u0026amp;redir_esc\u003dy page 72] — One anthropologist who compiled a vocabulary of native languages listed the word jumbuck as a verb meaning to communicate, ask or speak. This being so, then because sheep in a mob are continuously bleating and since most Australian animals are mute, it was quite feasible for them to call these talkative animals jumbucks.\u0026lt;/ref\u0026gt;* An English derivation is suggested in a corruption of the phrase \u0027\u0026quot;jump up\u0026quot;\u0027.\u0026lt;ref name\u003d ANDC /\u0026gt;\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A sheep\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1855\u0027\u0027, William Howitt, \u0027A Boy\u0027s Adventures in the Wilds of Australia: or, Herbert\u0027s Note-Book\u0027, %22jumbucks%22+-intitle:%22%22+-inauthor:%22%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003drX6ST8qTLMLimAWB26iCAg\u0026amp;redir_esc\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"%22jumbucks%22%20-intitle%3A%22%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse page 128\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Allan told them all that he thought necessary ; but, as he did not know what \u0027\u0027jumbucks\u0027\u0027 were, he candidly said so\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"“ Why, sheep, man, sheep ! They are \u0027\u0027jumbucks\u0027\u0027 in this country\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1895\u0027\u0027, w:Banjo Banjo Paterson\u0027, \u0027w:Waltzing Waltzing Matilda\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Along came a \u0027\u0027jumbuck\u0027\u0027 to drink at the billabong\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"1896\u0027\u0027, w:Henry Henry Lawson, \u0027Across the Straits\u0027, in \u0027While the Billy Boils\u0027, First Series, [http://www.gutenberg.org/files/7144/7144-h/7144-h.htm Gutenberg eBook\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"You may rip a sheep open whilst watching for the boss′s boots or yarning to a pen-mate, and then when you have stuffed the works back into the animal, and put a stitch in the slit, and poked it somewhere with a tar-stick (it doesn′t matter much where) the \u0027\u0027jumbuck\u0027\u0027 will be all right and just as lively as ever, and turn up next shearing without the ghost of a scratch on its skin\", \"priority\":9}]}, \"synonyms\":{}}");

